import UIKit

class StackedDrawables: UIView {

    private var iconScale: CGFloat = 0.70
    private var shouldPlaceIcons = true
    private var layers: [UIImageView] = []

    init(layers: [UIImage], iconScale: CGFloat = 0.70) {
        super.init(frame: .zero)
        self.iconScale = iconScale
        self.layers = layers.reversed().map { UIImageView(image: $0) }
        setupLayers()
    }

    required init?(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    private func setupLayers() {
        for (index, layer) in layers.enumerated() {
            layer.contentMode = .scaleAspectFit
            addSubview(layer)
            layer.translatesAutoresizingMaskIntoConstraints = false
        }
    }

    override func layoutSubviews() {
        super.layoutSubviews()
        if shouldPlaceIcons {
            placeIcons()
        } else {
            shouldPlaceIcons = true
        }
    }

    private func placeIcons() {
        shouldPlaceIcons = false
        let newWidth = bounds.width
        let iconsSize = floor(newWidth * iconScale)
        let iconsInset = newWidth - iconsSize - 1

        for (index, layer) in layers.enumerated() {
            layer.frame.size = CGSize(width: iconsSize, height: iconsSize)
            layer.center = CGPoint(x: bounds.midX, y: bounds.midY)

            switch index {
            case 1:
                layer.frame.origin = CGPoint(x: 0, y: iconsInset)
            case 0:
                layer.frame.origin = CGPoint(x: iconsInset, y: 0)
            default:
                break
            }
        }
    }

