from typing import Set, Any

class Group:
    def __init__(self, elements: Set[Any], operation: callable):
        self.elements = elements
        self.operation = operation

        # Verify group properties
        assert self.is_closed(), "Group is not closed under the operation."
        assert self.has_identity(), "Group does not have an identity element."
        assert self.has_inverses(), "Not all elements have an inverse."
        assert self.is_associative(), "Operation is not associative."

    def is_closed(self) -> bool:
        """Check if the group is closed under the operation."""
        for a in self.elements:
            for b in self.elements:
                if self.operation(a, b) not in self.elements:
                    return False
        return True

